import React, { Component } from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";

/* Begin Import Components */
import OrdersList from "./orders-list.component";
import OrderDetails from "./order-details.component";
import OrderCreate from "./order-create.component";
import OrderEdit from "./order-edit.component";
/* End Import Components */

function Order() {
    <Switch>
      {/* Begin Order Routes */}
      <Switch>
        <Route path="/orders/" exact component={OrdersList} />
        <Route path="/orders/new" exact component={OrderCreate} />
        <Route path="/orders/:id" exact component={OrderDetails} />
        <Route path="/orders/:id/edit" exact component={OrderEdit} />
      </Switch>
      {/* End Orders Routes */}
    </Switch>
}

class OrderComponent extends Component {


  render() {
    return (
      Order()
    );
  }
}

export default OrderComponent;
